import {GET_USER} from './ActionTypes';

interface GetUser {
    id:number,
}

export const getUser = (user:GetUser) => async (dispatch: any) => {
    
    let user = {

        id: 1,
        username:'tested',
        email:'tested',
        funds : 200,
        password : 'tested'

    }

    return dispatch({
        type: GET_USER,
        payload : user
    });

}
